    function switchImage(i, d) {

        var havepicture = 0;
        for (h = 0; h < lagepictures.length; h++) {
            if ('''' != lagepictures[h]) {
                havepicture++;
            }
        }

        var imgs = havepicture;

        if (havepicture > 1) {

            img += d;
            if (img >= imgs)
            { img = 0; }
            else if (img < 0)
            { img = imgs - 1 }

        }
        else {
