        }
        i.src = picurl + lagepictures[img];

    }



    function getElementLeft(elm) {
        var x = 0;

        //set x to elm''s offsetLeft
        x = elm.offsetLeft;

        //set elm to its offsetParent
        elm = elm.offsetParent;

        //use while loop to check if elm is null
        // if not then add current elm''s offsetLeft to x
        //offsetTop to y and set elm to its offsetParent

        while (elm != null) {
            x = parseInt(x) + parseInt(elm.offsetLeft);
            elm = elm.offsetParent;
        }
        return x;
    }

    function getElementTop(elm) {
        var y = 0;

        //set x to elm''s offsetLeft
        y = elm.offsetTop;

        //set elm to its offsetParent
        elm = elm.offsetParent;

        //use while loop to check if elm is null
        // if not then add current elm''s offsetLeft to x
        //offsetTop to y and set elm to its offsetParent

        while (elm != null) {
            y = parseInt(y) + parseInt(elm.offsetTop);
            elm = elm.offsetParent;
        }

        return y;
    }

    function Large(obj) {

        var imgbox = document.getElementById("imgbox");
        var imgframe = document.getElementById("imgframe");

        imgframe.style.position = ''absolute'';
        imgframe.style.background = ''url("http://media.elektronik-star.de/ebay_de/relaunch2013/img/bg.png") repeat scroll 0 0 transparent'';
        imgframe.style.fontsize = "0";
        imgframe.style.height = "5000px";
        imgframe.style.left = "0";
        imgframe.style.position = "absolute";
        imgframe.style.textalign = "center";
        imgframe.style.top = "0";
        imgframe.style.width = "100%";
        imgframe.style.visibility = ''visible'';

        imgbox.style.visibility = ''visible'';
        imgbox.style.cursor = ''pointer'';
        imgbox.style.fontsize = "0";
        imgbox.style.left = "0";
        imgbox.style.padding = "" + getElementTop(obj) - 50 + " 0 0 25%";

        var img = document.createElement("img");
        img.src = obj.src;
        img.style.height = "800px";
        img.style.width = "800px";

        if (img.addEventListener) {
            img.addEventListener(''click'', Out, false);
        } else {
            img.attachEvent(''click'', Out);
        }

        if (imgframe.addEventListener) {
            imgframe.addEventListener(''click'', Out, false);
        } else {
            imgframe.attachEvent(''click'', Out);
        }

        imgbox.innerHTML = '''';
        imgbox.appendChild(img);
        document.getElementById("ps_prev").style.visibility = ''hidden'';
        document.getElementById("ps_next").style.visibility = ''hidden'';

    }

    function Out(obj) {

        document.getElementById("ps_prev").style.visibility = ''visible'';
        document.getElementById("ps_next").style.visibility = ''visible'';
        document.getElementById("imgbox").style.visibility = ''hidden'';
        document.getElementById("imgframe").style.visibility = ''hidden'';


    }

    function BtnOut(obj) {

        document.getElementById("ps_prev").style.visibility = ''hidden'';
        document.getElementById("ps_next").style.visibility = ''hidden'';

    }

    function BtnIn(obj) {

        document.getElementById("ps_prev").style.visibility = ''visible'';
        document.getElementById("ps_next").style.visibility = ''visible'';
    }


